import React from "react";
import Icon from "@material-ui/core/Icon";

function LongCompIcon(props) {
    return (
        <Icon style={{textAlign: 'center', fontSize: '7.5rem',}}>
            <img {...props} height="100%" width="100%" alt="Long Composition"/>
        </Icon>
    );
}

export default LongCompIcon
